description:
Verenigde Staten
Horror
88 minuten

goed

met Amber Heard, Michael Welch en Anson Mount

Een groep scholieren besluit om het nette en lieve meisje Mandy Lane uit te nodigen voor een groot feest op een afgelegen 
ranch, aangezien Mandy Lane ineens een erg mooie meid is geworden. Maar dan ontdekken de scholieren dat het aantal aanwezigen 
op het feest op vreemde wijze begint te dalen. Dan blijkt er iets goed mis te zijn met die lieve, leuke en mooie Mandy Lane
